import React from 'react';
import { ChakraProvider } from "@chakra-ui/react"
import { Index } from "./pages/index.js";

function App( {Component, pageProps }) {
  return (
    <ChakraProvider>
      <Component {...pageProps} />
    </ChakraProvider>
  );
}

export default App;
